import React from 'react';

import { 
    Panel,
    PanelHeader,
    Placeholder,
    } from '@vkontakte/vkui';


import Icon56CheckCircleDeviceOutline from '@vkontakte/icons/dist/56/check_circle_device_outline';


export default class Start extends React.Component {
        constructor(props) {
            super(props);
            this.state = {

            }
            var propsbi = this.props.this;
            this.setPopout = propsbi.setPopout;
            this.showErrorAlert = propsbi.showErrorAlert;
        }
        render() {

            return (
                <Panel id={this.props.id}> 
                <PanelHeader
                >
                Road to Jedi
                </PanelHeader>

                <Placeholder 
                stretched
                icon={<Icon56CheckCircleDeviceOutline />}
                header='Отвечайте на разные вопросы пользователей ВКонтакте'>
                  Наш сервис не поддерживает вашу платформу из-за проблем с совместимостью
                  <br/>и обильного количества глюков (багов) на ней.
                  \<br/>Попробуйте зайти с другого устройства
                </Placeholder>
            </Panel>
            )
            }
        }
